import './Current.css';
import REturnArroW from './Arrow';
import ReturnTitle from './Title';
import REturnInput from './Time';
import ReturnSuBJect from './Subject';
import ReturnBtn from './Btn';

// Current View Component 
export default function ReturnCurrent() {
 return (
  <div className='wrp-current-money'>
   <REturnArroW />
   <ReturnTitle />
   <REturnInput />
   <ReturnSuBJect />
   <ReturnBtn />
  </div>
 );
};
